import {useParams} from "react-router-dom"
import useGetData from './useGetData';

export default function RecipeInfo() {
  const {id} = useParams();
  const {data, isLoading, error} = useGetData("http://localhost:8000/recipes/" + id);;

  return (
    <div>
        <h2>RecipeInfo - {id}</h2>
    </div>
  )
}
